import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';

function DetalhesOrcamento() {
  const { id } = useParams(); // Captura o ID do orçamento da URL
  const navigate = useNavigate();
  const [orcamento, setOrcamento] = useState(null);
  const [cliente, setCliente] = useState(null);

  // Carregar detalhes do orçamento e do cliente
  useEffect(() => {
    carregarOrcamento();
  }, [id]);

  const carregarOrcamento = async () => {
    try {
      // Busca os detalhes do orçamento
      const responseOrcamento = await fetch(`http://localhost:3000/orcamentos/${id}`);
      if (!responseOrcamento.ok) throw new Error('Erro ao carregar orçamento');
      const dataOrcamento = await responseOrcamento.json();
      setOrcamento(dataOrcamento);

      // Busca os detalhes do cliente associado ao orçamento
      const responseCliente = await fetch(`http://localhost:3000/clientes/${dataOrcamento.clienteId}`);
      if (!responseCliente.ok) throw new Error('Erro ao carregar cliente');
      const dataCliente = await responseCliente.json();
      setCliente(dataCliente);
    } catch (error) {
      console.error('Erro:', error);
      alert('Erro ao carregar detalhes do orçamento');
    }
  };

  if (!orcamento) return <div>Carregando...</div>;

  return (
    <div>
      <h1>Detalhes do Orçamento #{orcamento.id}</h1>
      <button onClick={() => navigate('/orcamentos')}>Voltar</button>

      {/* Dados do Cliente */}
      {cliente && (
        <div>
          <h2>Dados do Cliente</h2>
          <p><strong>Nome:</strong> {cliente.nome}</p>
          <p><strong>Número:</strong> {cliente.numero}</p>
          <p><strong>Técnico:</strong> {cliente.tecnico}</p>
          <p><strong>Modelo do Veículo:</strong> {cliente.modelo_veiculo}</p>
          <p><strong>Disjuntor de Entrada:</strong> {cliente.disjuntor_entrada}</p>
          <p><strong>Cabo de Entrada:</strong> {cliente.cabo_entrada}</p>
        </div>
      )}

      {/* Dados do Orçamento */}
      <div>
        <h2>Dados do Orçamento</h2>
        <p><strong>Distância:</strong> {orcamento.distancia} m</p>
        <p><strong>Quantidade de Eletrocalha:</strong> {orcamento.quantidadeEletrocalha} m</p>
        <p><strong>Quantidade de Duto Canaduto:</strong> {orcamento.quantidadeDutoCanaduto} m</p>
        <p><strong>Quantidade de Eletroduto PVC:</strong> {orcamento.quantidadeEletrodutoPVC} m</p>
        <p><strong>Desvios Canaduto:</strong> {orcamento.desviosCanaduto}</p>
        <p><strong>Desvios PVC:</strong> {orcamento.desviosPVC}</p>
        <p><strong>Conduletes:</strong> {orcamento.conduletes}</p>
        <p><strong>Quantidade de Curvas:</strong> {orcamento.quantidadeCurvas}</p>
        <p><strong>Observação:</strong> {orcamento.observacao}</p>
      </div>

      {/* Resultado do Orçamento */}
      <div>
        <h2>Resultado do Orçamento</h2>
        <pre>{orcamento.resultado}</pre>
      </div>
    </div>
  );
}

export default DetalhesOrcamento;
